public class HoneyBadger implements Animal
{
	// data
	String turtleShell;
	String name;

	// default constructor
	public HoneyBadger()
	{
		turtleShell = "Skunk-Bear-Gryllz";
		name = "Sir Prance-a-Lot";
	}

	// interface methods
	public void eat()
	{
		System.out.println("Eats bumblebees!!11!");
	}

	public void travel()
	{
		System.out.println("Prances about");
	}

	// getter methods
	public String getTurtleShell()
	{
		return turtleShell;
	}

	public String getName()
	{
		return name;
	}
}